import base64, zlib, gzip, sys
BASE62_CHARS="0123456789ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz"
def _base62_dec(d):
    d_s=d.decode();n=0
    for c in d_s:n=n*62+BASE62_CHARS.index(c)
    return n.to_bytes((n.bit_length()+7)//8,"big")if n else b"\x00"
def d(enc_data,ops):
    d=base64.b64decode(enc_data)
    for op in reversed(ops):
        if op=="zlib":d=zlib.decompress(d)
        elif op=="base62":d=_base62_dec(d)
        elif op=="gzip":d=gzip.decompress(d)
    return d.decode()
